  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This file contains a summary of service
  utilization by ASC supplier and is derived from 2011 ASC line item level data, updated
  through June 2012, that is, line items for services furnished on or after January
  1, 2011 through December 31, 2011 that were received, processed, paid, and passed
  to the National Claims History file by June 30, 2012.  This file contains data for
  ASC services billed in 2011, including services that were added under the revised
  ASC payment system.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
